CREATE DATABASE PokemonDB;
GO
USE PokemonDB;
GO
CREATE TABLE PokemonStats(
   pokedex_number    INTEGER  NOT NULL PRIMARY KEY 
  ,name              NVARCHAR(12) NOT NULL
  ,against_bug       NUMERIC(4,2) NOT NULL
  ,against_dark      NUMERIC(4,2) NOT NULL
  ,against_dragon    NUMERIC(3,1) NOT NULL
  ,against_electric  NUMERIC(4,2) NOT NULL
  ,against_fairy     NUMERIC(4,2) NOT NULL
  ,against_fight     NUMERIC(4,2) NOT NULL
  ,against_fire      NUMERIC(4,2) NOT NULL
  ,against_flying    NUMERIC(4,2) NOT NULL
  ,against_ghost     NUMERIC(3,1) NOT NULL
  ,against_grass     NUMERIC(4,2) NOT NULL
  ,against_ground    NUMERIC(4,2) NOT NULL
  ,against_ice       NUMERIC(4,2) NOT NULL
  ,against_normal    NUMERIC(4,2) NOT NULL
  ,against_poison    NUMERIC(4,2) NOT NULL
  ,against_psychic   NUMERIC(4,2) NOT NULL
  ,against_rock      NUMERIC(4,2) NOT NULL
  ,against_steel     NUMERIC(4,2) NOT NULL
  ,against_water     NUMERIC(4,2) NOT NULL
  ,attack            INTEGER  NOT NULL
  ,base_egg_steps    INTEGER  NOT NULL
  ,base_happiness    INTEGER  NOT NULL
  ,base_total        INTEGER  NOT NULL
  ,capture_rate      INTEGER  NOT NULL
  ,classification    NVARCHAR(51) NOT NULL
  ,defense           INTEGER  NOT NULL
  ,experience_growth INTEGER  NOT NULL
  ,height_m          NUMERIC(4,1)
  ,hp                INTEGER  NOT NULL
  ,percentage_male   NUMERIC(4,1)
  ,sp_attack         INTEGER  NOT NULL
  ,sp_defense        INTEGER  NOT NULL
  ,speed             INTEGER  NOT NULL
  ,type1             NVARCHAR(8) NOT NULL
  ,type2             NVARCHAR(8)
  ,weight_kg         NUMERIC(5,1)
  ,generation        INTEGER  NOT NULL
  ,is_legendary      BIT  NOT NULL
);
GO